(7, 4, 9, 'Extra room to fill?', 'Post your roommate searches here!\r\n\r\n Whether you''re looking to rent a room or have an extra room to fill, rentcampus''s Posting Board is the quickest way to find Temple roommates.', 1303752278, 1),
(8, 4, 11, 'Transfer student looking for a place', 'transfer student from JMU. lookin for a house/apt for 2011/2012 year. 19 yrs old,going to be junior.', 1304015301, 1),
(9, 5, 17, 'Spacious 2 or 3 bedrooms available close to TU!', 'Available in August, I will have a 2 or 3 bedroom place for rent $1200 and close to temple with all the amenities and a yard, dining room and living room- 2 floors and updated. Call 732-687-1877 or email me for more information marimar301@yahoo.com', 1304957854, 0),
(10, 5, 17, 'Spacious 2 Floor Unit w/ 3 Bedrooms avail Aug 2011', 'For more details on the space, check out this link to the add for 1926 N 5th St. More pictures available if needed: http://postlets.com/rts/5513085', 1304961059, 0),
(11, 5, 17, 'Spacious 2 & 3 Bedroom Unit Avail- 2 fls & Yard', 'Private entrance in front and rear. Two levels for the duplex space being rented. Enter to Living room and door to first floor bedroom. Both have 9 ft ceilings and ceiling fans as well as ACs. New wood flooring on complete 1st Floor. Living rooms flows into Dining Room/Eating Area, updated/remodeled bathroom and kitchen. Kitchen equipped with refrigerator, built in microwave, oven/stove and garbage disposal. Exterior yard can be used for outside entertainment or additional rear parking. Lower level finished with ceramic tile, recessed lighting and spacious bedrooms with more than ample closet space. Mobile/ Modern air conditioning units for entire unit. Close to Girard and downtown nightlife and 10 minute walk to Templeâ€™s campus. Plenty of safe street parking right outside your door. A GREAT block, old neighborhood with good neighbors. Grocery (Cousin''s) in rear along with 24/7 laundry facility. Tenant pays electric and gas, both moderate. Will talk about installing washing/drying appliance in unit if is an issue. Call Marisa for an appointment 732-687-1877 or email marimar301@yahoo.com \r\nAvail August 2011', 1310747595, 0);
