(11, 6, 1, 0, 6, '1202 W. Dauphin St., Unit 2', '', 6, '0', '', '1', 1343793600, 'Awesome 4-bedroom townhouse located steps away from Templeâ€™s main campus. \r\nJust minutes from shops, restaurants, laundry, and entertainment.  Take the Broad street line to Center City or cab it to Northern Liberties just 10 minutes away.  Regional Rail and numerous bus routes are also at your fingertips.', '<p>\r\n<p>Awesome 4-bedroom townhouse located steps away from Temple&rsquo;s main campus.&nbsp;</p>\r\n<p>Just minutes from shops, restaurants, laundry, and entertainment. &nbsp;Take the Broad street line to Center City or cab it to Northern Liberties just 10 minutes away. &nbsp;Regional Rail and numerous bus routes are also at your fingertips.</p>\r\n</p>', '', '1200', '300', '1200', '1200', '1200', '', '', '1202 W Dauphin', '2', 'Philadelphia', 'PA', '19133', 39.987350, -75.152390, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 494),
(10, 6, 1, 1, 4, '1202 W. Dauphin St., Unit 1', '', 6, '0', '', '1', 0, 'Beautiful bright 2-bedroom unit with spacious common area and kitchen.  Located one block from Templeâ€™s main campus, central to university shops, restaurants, laundry and entertainment.  Stay in a well patrolled safe neighborhood with great neighbors and easy access to amenities.  Center City, and trendy Northern Liberties are just minutes away!', '<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', '900', '450', '0', '0', '0', '', '', '1202 W Dauphin St.', '1', 'Philadelphia', 'PA', '19133', 39.987350, -75.152390, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 495),
(27, 2, 1, 0, 3, '1517 N 15th St. Unit 2M', 'Doran LLc', 6, '9', 'temple campus', '1', 1343793600, 'Spacious 1-bedroom apartment. The house is just a few blocks from Temple''s main campus, close to shops, restaurants, entertainment, and on site laundry and 24/7 security.  Blocks away from the Broad Street Line, Regional Rail, Bus routes and minutes from Center City and Northern Liberties.', '<p>AVAILABLE 8/1/12!&nbsp;Extra large one bedroom apartment,&nbsp;Easy access to university resources, off-campus lifestyle on-campus, and a community of students. Each bedroom comes with a bed, work station, dresser, and ample closet space. The living room comes fully furnished including a sofa, coffee table, and dining table. Storage units in the basement, laundry room on premises.&nbsp;</p>\r\n<p>&nbsp;</p>', 'http://www.chattersource.com/housing/19121/1517-n-15th-street', '900', '900', '0', '0', '0', '', '', '1517 N 15th St.', '2M', 'Philadelphia', 'PA', '19121', 39.976372, -75.160095, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 493),
(28, 2, 1, 1, 4, '1517 N 15th St. Unit B', '', 6, '0', '', '1', 1338523200, 'Spacious 2-bedroom unit fit for young driven college students.  Great space to relax and focus on studies.  The house is just a few blocks from Temple main campus, close to shops, restaurants, entertainment, on site laundry and 24/7 security.  Blocks away from the Broad Street Line, Regional Rail, Bus routes and minutes from Center City and Northern Liberties.', '<p>Great location: Mostly Temple students on the block. Only 1 block  from Broad Street, Fresh Grocer, and Rite Aid. Only 2 blocks away  from the Rec Center, track field, and The Liacouras Center.</p>', '', '1100', '550', '0', '0', '0', '', '', '1517 N 15th St.', 'B', 'Philadelphia', 'PA', '19121', 39.976372, -75.160095, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 492),
(29, 2, 1, 1, 7, '1517 N 15th St. Unit 3F', '', 6, '0', '', '5', 1280635200, 'Spacious 5-bedroom Townhouse fit for young driven college students.  Great space to relax and focus on studies.  The house is just a few blocks from Temple main campus, close to shops, restaurants, laundry and entertainment.  Blocks away from the Broad Street Line, Regional Rail, Bus routes and minutes from Center City and Northern Liberties.', '<p>&nbsp;Live right on campus with easy access to all of Temple''s university resources! You will have an off-campus lifestyle right on-campus near all of the action. This is a great 5 bedroom apartment with plenty of space for everyone with its spacious 3 bathrooms. *either all 5 BR available or 3 bedrooms are available*</p>', '', '3000', '600', '0', '0', '0', '', '', '1517 N. 15th St.', '3F', 'Philadelphia', 'PA', '19121', 39.976372, -75.160095, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 491),
(30, 2, 1, 1, 4, '1521 N 15th St. Unit 2R', '', 6, '0', '', '1', 0, 'Convenient 2-bedroom apartment located steps away from Templeâ€™s main campus, perfect for mature, creative college students. Just minutes from shops, restaurants, laundry, and entertainment.  Take the Broad street line to Center City or cab it to Northern Liberties just 10 minutes away.  Regional Rail and numerous bus routes are also at your fingertips.', '<p>&nbsp;A beautiful 2 bedroom apartment that is right in the heart of Temple''s campus.&nbsp;</p>', '', '1250', '625', '0', '0', '0', '', '', '1521 N 15th St.', '2R', 'Philadelphia', 'PA', '19121', 39.976944, -75.161285, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 490),
(37, 5, 1, 0, 7, '1614 Susquehanna Ave', '', 4, '0', '', '2', 0, 'Great newly renovated 5-bedroom unit with spacious living area, new kitchen and bathroom.  Close walking distance to Templeâ€™s main campus, restaurants, shops, laundry, and entertainment.  Blocks away from Broad Street Subway, Bus routes, Regional Rail, and minutes from Center City and Northern Liberties.', '', '', '3200', '460', '0', '0', '0', '', '', '1614 Susquehanna Ave', '', 'Philadelphia', 'PA', '19121', 39.986694, -75.159943, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 489),
(38, 5, 1, 0, 7, '1625 Edgley St', '', 4, '0', '', '2', 1312171200, 'Incredible newly renovated 5-bedroom unit with spacious living area, new kitchen and bathroom.  Close walking distance to Templeâ€™s main campus, restaurants, shops, laundry, and entertainment.  Blocks away from Broad Street Subway, Bus routes, Regional Rail, and minutes from Center City and Northern Liberties.', '<p>This newly renovated townhouse is on Edgley street, just a half block north of Diamond, is easily the nicest house on the block. It has a beautiful well appointed kitchen with tile floors and modern stainless steel appliances. Do your laundry right inside the house. Huge bedrooms that are all equal sizes and an intimate backyard, perfect for house BBQs. Just steps away from Temple''s main campus!</p>', '', '2750', '550', '0', '0', '0', '', '', '1625 Edgley St', '', 'Philadelphia', 'PA', '19121', 39.986019, -75.160400, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 488),
(39, 4, 1, 0, 6, '1634 Gratz St Unit B (2nd Fl)', '', 6, '0', '', '2', 0, 'Beautiful convenient newly renovated 4-bedroom Townhouse fit for young driven college students.  Great space to relax and focus on studies.  The house is just a few blocks from Temple main campus, close to shops, restaurants, laundry and entertainment.  Blocks away from the Broad Street Line, Regional Rail, Bus routes and minutes from Center City and Northern Liberties.', '<p>Totally remodelled 4 bedroom bi-level apartment. Hardwood floors throughout living room and bedrooms. Kitchen with stainless steel appliances. Central air, washer and dryer inside. Owner pays for the security system, and there are many students on the block.&nbsp;</p>', '', '2200', '550', '0', '0', '0', '', '', '1634 Gratz St.', 'B', 'Philadelphia', 'PA', '19121', 39.979080, -75.165398, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 487),
(40, 3, 1, 0, 7, '1712 W Diamond St Unit 2', '', 6, '0', '', '2', 0, 'Awesome newly renovated 5-bedroom townhouse located steps away from Templeâ€™s main campus, perfect for mature, creative college students. Just minutes from shops, restaurants, laundry, and entertainment.  Take the Broad street line to Center City or cab it to Northern Liberties just 10 minutes away.  Regional Rail and numerous bus routes are also at your fingertips.', '<p>Features a full kitchen with all new modern appliances including a dishwasher! Also do your laundry right inside the building. Central A/C and heat, all a short walk to Temple''s main campus.</p>', '', '2575', '515', '0', '0', '0', '', '', '1712 Diamond St.', '2', 'Philadelphia', 'PA', '19121', 39.985195, -75.161919, 0, 0, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946742400, 946764000, 946749600, 946760400, 486),
