(409, 3, 1, 1, 7, '1614 Gratz', '', 4, '0', '', '2', 1343793600, 'AVAILABLE AUGUST FIRST 2012\r\n\r\n-Sign now and ALL UTILITIES ARE INCLUDED!!\r\n\r\n- Video Surveillance System & Alarm System provided by landlord \r\n\r\n- Quiet and Safe block: across the street from a school\r\n\r\n- Lots of students already leased up on the block\r\n\r\n-Ideal layout for roommates with very similarly sized bedrooms, each with a closet\r\n\r\n-Stainless steel appliances in the eat-in kitchen\r\n\r\n-Large Open living area.\r\n\r\n- Laundry facilities in the basement\r\n\r\n-Fenced in yard\r\n\r\n-Central air\r\n\r\n-Security bars on all lower level windows', '<p><style type="text/css">p.MsoNormal, li.MsoNormal, div.MsoNormal { margin: 0in 0in 0.0001pt; font-size: 12pt; font-family: "Times New Roman"; }.MsoChpDefault { font-size: 10pt; }div.WordSection1 { page: WordSection1; }</style></p>\r\n<p class="MsoNormal"><b style="">*ready to move in: August 1, 2012*</b></p>\r\n<p class="MsoNormal"><b style="">Rent: </b></p>\r\n<p class="MsoNormal">500/bedroom (which includes all utilities) for a group of 5 students (ask about pricing for groups of 3 or 4 students)</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><b style="">Location:</b></p>\r\n<p class="MsoNormal">Short walk to campus, movie theatre, grocery store, hardware store, &amp; new international student dorm</p>\r\n<p class="MsoNormal">Across the street from a school so its safe &amp; comfortable</p>\r\n<p class="MsoNormal">Great Block with other students living here</p>\r\n<p class="MsoNormal">Easy walk to Edge Dormitory &amp; Oxford Village</p>\r\n<p class="MsoNormal">Located on the preferred south side of campus</p>\r\n<p class="MsoNormal">Approximately one and a half blocks from police station &amp; fire station</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><b style="">Property Features:</b></p>\r\n<p class="MsoNormal">Great similarly sized bedrooms, each with its own spacious closet</p>\r\n<p class="MsoNormal">Large Open living area</p>\r\n<p class="MsoNormal">Renovated Kitchen w/ Granite Countertop, Dishwasher and Microwave</p>\r\n<p class="MsoNormal">Includes Washer &amp; Dryer in Basement</p>\r\n<p class="MsoNormal">Hardwood Floors throughout entire first floor</p>\r\n<p class="MsoNormal">Gigantic Basement</p>\r\n<p class="MsoNormal">Brand new Stainless Steel Appliances</p>\r\n<p class="MsoNormal">Fenced In Yard with outdoor space</p>\r\n<p class="MsoNormal">Central Heat &amp; A/C</p>\r\n<p class="MsoNormal">Street Parking available.</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><b style="">Security Features:</b></p>\r\n<p class="MsoNormal">Video Surveillance System with multiple cameras covering all sides of property</p>\r\n<p class="MsoNormal">Bars on all first floor windows</p>\r\n<p class="MsoNormal">Security Doors on Front and Back</p>\r\n<p class="MsoNormal">Audible Alarm System</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><b style="">Landlords:</b></p>\r\n<p class="MsoNormal">Great landlords who seek to make sure tenants are safe, comfortable, and enjoy their experience.</p>\r\n<p class="MsoNormal">Excellent recommendations available from current tenants</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><i style=""><u>Landlord Pays:</u></i></p>\r\n<p class="MsoNormal">1. Gas &amp; Electric</p>\r\n<p class="MsoNormal">2. Water</p>\r\n<p class="MsoNormal">3. Internet</p>\r\n<p class="MsoNormal">4. Video Surveillance System</p>\r\n<p class="MsoNormal">5. Alarm System</p>\r\n<p class="MsoNormal">6. Garbage</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal"><i style=""><u>Tenant Pays:</u></i></p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">&nbsp;</p>\r\n<p class="MsoNormal">*********Available to groups of 3 or groups of 4 students with attractive pricing.</p>\r\n<p class="MsoNormal">*********Special incentives for signing early (utilities, renovations, furniture, etc)</p>\r\n<p class="MsoNormal">*********Flexible payment terms</p>\r\n<p>&nbsp;</p>', '', '2500', '500', '2500', '2500', '2500', '', '', '1614 N Gratz', '', 'Philadelphia', 'PA', '19121', 39.978642, -75.165489, 0, 0, 946735200, 946767600, 946735200, 946767600, 946735200, 946767600, 946735200, 946767600, 946735200, 946767600, 946749600, 946767600, 185),
